type versebuilder []*deployment

func (p *versebuilder) deploy(state StateDB, block uint64) {
	isMainnet := GenesisHash == params.OasysMainnetGenesisHash
	for _, c := range *p {
		cpy := c.copy()
		if c.contract == l1BuildDeposit {
			if isMainnet {
				// uint256 public requiredAmount
				cpy.storage["0x00"] = new(big.Int).Mul(big.NewInt(params.Ether), big.NewInt(1_000_000))
				// uint256 public lockedBlock
				cpy.storage["0x01"] = big.NewInt(1_036_800)
			} else {
				cpy.storage["0x00"] = big.NewInt(params.GWei)
				cpy.storage["0x01"] = common.Big1
			}
		}
		if c.contract == l1BuildAllowList && isMainnet {
			// address private _owner
			cpy.storage["0x00"] = common.HexToAddress(mainnetGenesisWallet)
		}
		cpy.deploy(state, block)
	}
}
